import React, { Component } from 'react';

class Services extends Component {
  render() {
    return (
      <div id='services'>
        <div id='title'>Services</div>
        <div>
          <div>
          <i class="bi bi-code-slash"></i>
          <div>Web Design</div>
          
          </div>
        </div>
      </div>
    );
  }
}

export default Services;
